// SPDX-License-Identifier: MEH

pragma solidity ^0.8.0;

import "./oz/ERC721Enumerable.sol";
import "./oz/Ownable.sol";
import "./oz/AccessControl.sol";


contract MintCaseManager {
    function okToMint(uint256 _seriesId, address _by) external view returns(bool,uint256) {}
    function tokenMinted(uint256 _seriesId) external view {}
}

contract MintCaseMinter is ERC721Enumerable, AccessControl, Ownable {

    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    mapping(uint256 => bytes32) public tokenIdHashes;
    mapping(uint256 => uint256) public tokenIdToSeriesId;

    MintCaseManager mintManager;

    constructor(address _managerAddress, string memory _tokenName, string memory _tokenSymbol) ERC721(_tokenName, _tokenSymbol) {

        _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());
        _setupRole(MINTER_ROLE,_msgSender());

        mintManager = MintCaseManager(_managerAddress);
	}

    function mint(uint256 _seriesId, address _to, address _by) external onlyRole(MINTER_ROLE) returns (uint256) {

        bool ok;
        uint256 tokenId;
        (ok,tokenId) = mintManager.okToMint(_seriesId, _by);
        require(ok,"Not ok.");

        bytes32 tokenHash = keccak256(abi.encodePacked(tokenId, block.number, _to, block.timestamp));
        tokenIdHashes[tokenId]= tokenHash;
        tokenIdToSeriesId[tokenId] = _seriesId;
        _mint(_to, tokenId);
        return tokenId;
    }



    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC721Enumerable, AccessControl) returns (bool) {
        return interfaceId == type(ERC721Enumerable).interfaceId || super.supportsInterface(interfaceId);
    }
}
